import Expenses from "./components/Expenses/Exenses";

function App() {
  const expences = [
    {
      title: "Car Insurance",
      amount: "10000",
      date: new Date(2021, 12, 28),
    },
    {
      title: "Toilet Paper",
      amount: "10000",
      date: new Date(2021, 2, 8),
    },
    {
      title: "New TV",
      amount: "10000",
      date: new Date(), //Gives current date
    },
    {
      title: "Car Insurance",
      amount: "10000",
      date: new Date(2021, 5, 2),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expences} />
    </div>
  );
}

export default App;
